INSERT INTO `informes` (`id_informe`, `fecha_informe`, `de_informe`, `a_informe`, `num_informe`, `asunto_informe`, `conclusion_informe`, `encargado_informe`, `herra_seleccionados`) VALUES
(1, '2023-08-12', 'JUAN ALANOCA MORALES', 'LEANDRO SUAZO GARCIA', 'AH018-23 ', 'Devolución de Material a BoA.  ', 'Fragmento de un escrito con unidad temática, que queda diferenciado del resto de fragmentos por un punto y aparte y generalmente también por llevar letra mayúscula inicial y un espacio en blanco en el margen izquierdo de alineación del texto principal de la primera línea.', 'Samuel Quispe Huchani ', '3,5,7,8'),
(2, '2023-08-13', 'LUCIO URUCHI LIMACHI', 'HUGO DORREGO PEREZ', 'AH018-25', 'PRESTAMOS POR LOSTES', 'Todos los textos contienen párrafos, incluso si se trata de uno solo. Se reconocen fácilmente en los escritos porque inician con mayúsculas y finalizan con un punto y aparte. Usualmente terminan cuando una misma idea o perspectiva sobre un tema ha sido agotada por el autor, es decir, cuando ya no tiene nada más que añadir al respecto, y por eso abre un párrafo nuevo y continúa con otras ideas o perspectivas.\n\nFuente: https://concepto.de/parrafo/#ixzz8AIdyjLuF', 'LUIS AGUSTIN FERNANDEZ', '8,10,28,30'),
(3, '2023-08-14', 'JUANA PEREZ SANCHEZ', 'MARCO A AMARU FERNANDEZ', 'AH018-26', 'PRESTAMO DE CAJAS HERRAMIENTAS', 'A la hora de la exposición se sigue la misma estructura que el informe escrito (introducción, cuerpo y conclusión). Debe ser claro y breve, sin excederse en detalles, ni tampoco omitiendo partes importantes. Aquí entran en juego los conocimientos sobre oratoria.', 'HEBERT LAYME PACOSILLO', '5,11,20'),
(4, '2023-08-14', 'JUAN ALANOCA MORALES', 'MARCO A AMARU FERNANDEZ', 'AH018-23 ', 'PRESTAMO DE CAJAS HERRAMIENTAS', 'Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor (N. del T. persona que se dedica a la imprenta) desconocido usó una galería de textos y los mezcló de tal manera que logró hacer un libro de textos especimen. ', 'LUIS AGUSTIN FERNANDEZ', '4,6,8,16,28'),
(5, '2023-08-17', 'Adri', 'Sami', 'N°123', 'Informw', 'Fragmento de un escrito con unidad temática, que queda diferenciado del resto de fragmentos por un punto y aparte y generalmente también por llevar letra mayúscula inicial y un espacio en blanco en el margen izquierdo de alineación del texto principal de la primera línea.', 'mio', '2,3'),
