(1, 'SAE 2210/232', 'SAE 2210-23', '1', 'EVACUATION SLIDE', 'D31050-105', 'UNO', '1246', 'RESTAURATION AND HYDROSTATIC TEST', '- EL COMPONENTE IDENTIFICADO EN EL ITEM No. 7, FUE DESARMADO, LIMPIADO E INSPECCIONADO SIN DISCREPANCIAS, SE REALIZO PRUEBAS DE SOBREPRESION Y VERIFICACION DE INTEGRIDAD DEL INFLABLE DENTRO LIMITES ACORDE A FIGURA 105 DEL CMM 25-60-36, SE REALIZO PRUEBA HIDROSTATICA SIN DISCREPANCIAS VER FORM. ADJUNTO SAETEE 840 Y ENSAMBLAJE DE TOBOGAN DE ACUERDO A CMM 25-60-36 REV. 28 DATED 20 JUN 2018. Y FOLDING PROCEDURE P-12089 REV. F DEL  5 DE FEB 2018.\r\n- DATOS DEL TOBOGAN: FECHA DE FABRICACION MAR/1995\r\n- DATOS DEL CILINDRO: FECHA DE FABRICACION SEP/2013; FECHA DE ULTIMO HYDROTEST: NOV/2023, PROXIMA PRUEBA HIDROSTATICA: NOV/2026\r\n- DATOS DE LA BATERIA: FECHA DE FABRICACION MAY/2023; FECHA EXPIRACION MAY/2028; Pre Pack 9.99 voltios, 519 miliamperios; Post Pack 10.00 voltios a 75.9 °F, 518 miliamperios, dentro límites de acuerdo a manual CMM 25-60-36 pag. 131.  \r\n- PROXIMA INSPECCION NOV/2024\r\n- NINGUNA DIRECTRIZ DE AERONAVEGABILIDAD, FUE APLICADA DURANTE EL PROCESO DE INSPECCION DEL COMPONENTE.\r\n- EVACUATION SLIDE P/N D31050-105 & S/N 1246 ES PARTE DEL ASSY P/N D31005-SERIES', 'HUGO JORGE GAMBOA DIAZ', '2023-11-23'),
(2, 'SAE 2172-23/233', 'SAE 2172-23', '1', 'HYDROTEST HIDROSTATICA', 'D31050-105-56445-456', 'UNO', '1234565', 'SAETEE 840 Y ENSAMBLAJE DE TOBOGAN ', '-	PROXIMA INSPECCION NOV/2024\r\n-	NINGUNA DIRECTRIZ DE AERONAVEGABILIDAD, FUE APLICADA DURANTE EL PROCESO DE INSPECCION DEL COMPONENTE.\r\n-	EVACUATION SLIDE P/N D31050-105 & S/N 1246 ES PARTE DEL ASSY P/N D31005-SERIES', 'HUGO JORGE GAMBOA DIAZ SAE', '2023-12-01');
